import logo from './logo.svg';
import './App.css';
import { Fragment } from 'react';

function App() {
  return (
    <Fragment>
      <div className='container col-md-6'>
          <div className='card'>
              <div className='card-head text-center'>
                <p>helooooo im rose</p>
              </div>
              <div className='card-body'>
                  <p>im body</p>
              </div>
          </div>
      </div>
    </Fragment>
  );
}

export default App;
